
package org.openapitools.client.model


case class ChatCompletionResponseMessage (
    /* The contents of the message. */
    _content: String,
    /* The refusal message generated by the model. */
    _refusal: String,
    /* The tool calls generated by the model, such as function calls. */
    _toolCalls: Option[List[ChatCompletionMessageToolCall]],
    /* The role of the author of this message. */
    _role: String,
    _functionCall: Option[ChatCompletionResponseMessageFunctionCall],
    _audio: Option[ChatCompletionResponseMessageAudio]
)
object ChatCompletionResponseMessage {
    def toStringBody(var_content: Object, var_refusal: Object, var_toolCalls: Object, var_role: Object, var_functionCall: Object, var_audio: Object) =
        s"""
        | {
        | "content":$var_content,"refusal":$var_refusal,"toolCalls":$var_toolCalls,"role":$var_role,"functionCall":$var_functionCall,"audio":$var_audio
        | }
        """.stripMargin
}
